      <div className='flex flex-col '>
        <input className="border-2 border-rounded-xl border-gray-600 my-2 p-2" type="text"  placeholder="UserName" />
        <input className="border-2 border-rounded-xl border-gray-600  my-2 p-2" type="text" placeholder="Password" />
      </div>
    </div>
  );
};

export default Login;
